EVM的存储结构
    stack(栈 1024个槽 每槽32字节)
    memory(EVM自身的存储)
    storage(链上存储)
    calldata(函数参数的存储区域)
    code(智能合约的字节码)

    基本数据类型是少于32字节的 都存在栈 而大于32字节或者长度未知的都存在memory或者storage
    基本数据类型：
        整数 int系列
        bool
        地址
        bytes系列
        enum 枚举
    引用类型
        数组
        字符串
        结构体
        映射

*/

